private class AliasedTypeNode implements com.google.javascript.jscomp.ScopedAliases.AliasUsage {
    private final com.google.javascript.rhino.Node typeReference;

    private final com.google.javascript.rhino.Node aliasDefinition;

    private final java.lang.String aliasName;

    AliasedTypeNode(com.google.javascript.rhino.Node typeReference, com.google.javascript.rhino.Node aliasDefinition, java.lang.String aliasName) {
        this.typeReference = typeReference;
        this.aliasDefinition = aliasDefinition;
        this.aliasName = aliasName;
    }

    @java.lang.Override
    public void applyAlias() {
        java.lang.String typeName = typeReference.getString();
        java.lang.String aliasExpanded = com.google.common.base.Preconditions.checkNotNull(aliasDefinition.getQualifiedName());
        com.google.common.base.Preconditions.checkState(typeName.startsWith(aliasName));
        typeReference.setString(typeName.replaceFirst(aliasName, aliasExpanded));
    }
}

